CREATE TABLE "NMT2"."PARTNER"
(
    PARTNER_ID NUMBER PRIMARY KEY NOT NULL,
    NAVN varchar2(255) NOT NULL,
    HER_ID varchar2(50),
    ORGNUMMER varchar2(50),
    KOMMUNIKASJONSSYSTEM_ID NUMBER NOT NULL
);
ALTER TABLE "NMT2"."PARTNER"
    ADD CONSTRAINT PARTNER_KOMMUNIKASJONSSYSTEM
        FOREIGN KEY (KOMMUNIKASJONSSYSTEM_ID)
            REFERENCES "KOMMUNIKASJONSSYSTEM"(KOMMUNIKASJONSSYSTEM_ID);

CREATE TABLE "NMT2"."PARTNER_CPA"
(
    CPA_ID varchar2(50) PRIMARY KEY NOT NULL,
    PARTNER_ID NUMBER NOT NULL,
    NAV_CPP_ID varchar2(100) NOT NULL,
    PARTNER_CPP_ID varchar2(100) NOT NULL,
    PARTNER_SUBJECTDN varchar2(1024) NOT NULL,
    PARTNER_ENDPOINT varchar2(512) NOT NULL,
    LASTUSED timestamp
);
ALTER TABLE "NMT2"."PARTNER_CPA"
    ADD CONSTRAINT PARTNER_CPA_PARTNER
        FOREIGN KEY (PARTNER_ID)
            REFERENCES "PARTNER"(PARTNER_ID);
CREATE INDEX PARTCPA_PARTNERID_INDEX ON "PARTNER_CPA"(PARTNER_ID);

CREATE TABLE "NMT2"."PARTNER_JOBB"
(
    JOBB_ID varchar2(80) PRIMARY KEY NOT NULL,
    PARTNER_ID NUMBER,
    PROTOKOLL varchar2(50),
    ENDPOINT varchar2(50),
    CRONEEXPRESSION varchar2(50),
    ENDRINGSDATO timestamp,
    KRYPTERINGSSERTIFIKAT varchar2(50),
    SIGNERINGSSERTIFIKAT varchar2(50)
);
ALTER TABLE "NMT2"."PARTNER_JOBB"
    ADD CONSTRAINT PARTNER_JOBB_PARTNER
        FOREIGN KEY (PARTNER_ID)
            REFERENCES "PARTNER"(PARTNER_ID);

CREATE TABLE "NMT2"."PARTNER_MAPPING"
(
    PARTNER_MAPPING_ID NUMBER PRIMARY KEY NOT NULL,
    PARTNER_ID NUMBER NOT NULL,
    OLD_PARTNERREF varchar2(255) NOT NULL
);
ALTER TABLE "NMT2"."PARTNER_MAPPING"
    ADD CONSTRAINT PARTNER_MAPPING_PARTNER_FK1
        FOREIGN KEY (PARTNER_ID)
            REFERENCES "PARTNER"(PARTNER_ID);
CREATE UNIQUE INDEX OLDREF_INDEX1 ON "PARTNER_MAPPING"(OLD_PARTNERREF);

